import React from "react";
import Clubs from "./Clubs";

const ClubList = (props) => {
  const clubItems = props.list.map((item) => {
    return (
      <li>
        <Clubs name={item.name} icon={item.fa} />
      </li>
    );
  });
  return <ul>{clubItems}</ul>;
};

export default ClubList;
